import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import SpotTaxCalculator from "./components/SpotTaxCalculator";
import FuturesTaxCalculator from "./components/FuturesTaxCalculator";

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/spot" element={<SpotTaxCalculator />} />
        <Route path="/futures" element={<FuturesTaxCalculator />} />
      </Routes>
    </Router>
  );
};

export default App;
